(function(document){"use strict";document.addEventListener("impress:init",function(event){var api=event.detail.api;var gc=api.lib.gc;var util=api.lib.util;var isNavigationEvent=function(event){if(event.altKey||event.ctrlKey||event.metaKey){return false}if(event.keyCode===9){return true}if(event.shiftKey){return false}if(event.target.nodeName!=="BODY"&&event.target.nodeName!=="HTML"){return false}if(event.keyCode>=32&&event.keyCode<=34||event.keyCode>=37&&event.keyCode<=40){return true}};gc.addEventListener(document,"keydown",function(event){if(isNavigationEvent(event)){event.preventDefault()}},false);gc.addEventListener(document,"keyup",function(event){if(isNavigationEvent(event)){if(event.shiftKey){switch(event.keyCode){case 9:api.prev();break}}else{switch(event.keyCode){case 33:case 37:case 38:api.prev(event);break;case 9:case 32:case 34:case 39:case 40:api.next(event);break}}event.preventDefault()}},false);gc.addEventListener(document,"click",function(event){var target=event.target;while(target.tagName!=="A"&&target!==document.documentElement){target=target.parentNode}if(target.tagName==="A"){var href=target.getAttribute("href");if(href&&href[0]==="#"){target=document.getElementById(href.slice(1))}}if(api.goto(target)){event.stopImmediatePropagation();event.preventDefault()}},false);gc.addEventListener(document,"click",function(event){var target=event.target;while(!(target.classList.contains("step")&&!target.classList.contains("active"))&&target!==document.documentElement){target=target.parentNode}if(api.goto(target)){event.preventDefault()}},false);util.triggerEvent(document,"impress:help:add",{command:"Left &amp; Right",text:"Previous &amp; Next step",row:1})},false)})(document);